The best season of all is infiltrating 2020! Spooky season (in my opinion) is officially upon us! Bring in ALL the pumpkins. ALL the oranges and purples and greens. It’s the most wonderful time of the year 💀 Halloween and Fall are my favorite times to wear everything spooky, do spooky things, watch spooky movies, and decorate everything in Halloween decor! My best Disney outfits come alive with my spooky attire too that’s for sure 👻 This is probably one of my favorite spirit jerseys from the first Oogie Boogie Bash last Halloween season at DCA. I miss Disneyland 🥺 and I miss the Halloween decorations. I miss Oogie Boogie greeting me as I enter DCA. I miss it all. I want it back. I want to just sit on Main Street and sit on Sunset Blvd and just soak up all the magic. I miss my escape to fantasy and I’m just tired of 2020. 2020 has just been a constant stream of energy sucking and set backs. For many people. I try to find the positives in everyday life 💚 Embrace the spooky season! Be basic, have a Pumpkin Spice Latte (iced of course), watch the 90s nostalgia movies Hocus Pocus and NBC, spend way too much money at Hobby Lobby on pumpkins galore and just enjoy it! It’s good for your soul!
